import React, {useState} from 'react';
import "./App.css"
import Nota from "./componentes/nota"
import Resultado from "./componentes/resultado"


const App = () => {
    const[nota1, setNota1] = useState(0)
    const[nota2, setNota2] = useState(0)
    const[nota3, setNota3] = useState(0)
    const[nota4, setNota4] = useState(0)

return (
    <main class="App">
        <Nota num={1} nota={nota1} setNota={setNota1}/><br />
        <Nota num={2} nota={nota2} setNota={setNota2}/><br />
        <Nota num={3} nota={nota3} setNota={setNota3}/><br />
        <Nota num={4} nota={nota4} setNota={setNota4}/><br />

        <Resultado SomaNotas={parseFloat.nota1+nota2+nota3+nota4}/>
     </main>)
}

export default App;
